  this.maxRange();
};

/**
 * Prefix/Select/Visual/Search Modes
 */

Terminal.prototype.enterPrefix = function() {
  this.prefixMode = true;
};

Terminal.prototype.leavePrefix = function() {
  this.prefixMode = false;
};

Terminal.prototype.enterSelect = function() {
  this._real = {
    x: this.x,
    y: this.y,
    ydisp: this.ydisp,
    ybase: this.ybase,
    cursorHidden: this.cursorHidden,
    lines: this.copyBuffer(this.lines),
    write: this.write
  };
  this.write = function() {};
  this.selectMode = true;
  this.visualMode = false;
  this.cursorHidden = false;
  this.refresh(this.y, this.y);
};

Terminal.prototype.leaveSelect = function() {
  this.x = this._real.x;
  this.y = this._real.y;
  this.ydisp = this._real.ydisp;
  this.ybase = this._real.ybase;
  this.cursorHidden = this._real.cursorHidden;
  this.lines = this._real.lines;
  this.write = this._real.write;
  delete this._real;
  this.selectMode = false;
  this.visualMode = false;
  this.refresh(0, this.rows - 1);
};

Terminal.prototype.enterVisual = function() {
  this._real.preVisual = this.copyBuffer(this.lines);
  this.selectText(this.x, this.x, this.ydisp + this.y, this.ydisp + this.y);
  this.visualMode = true;
};

Terminal.prototype.leaveVisual = function() {
  this.lines = this._real.preVisual;
  delete this._real.preVisual;
  delete this._selected;
  this.visualMode = false;
  this.refresh(0, this.rows - 1);
};

Terminal.prototype.enterSearch = function(down) {
  this.entry = '';
  this.searchMode = true;
  this.searchDown = down;
  this._real.preSearch = this.copyBuffer(this.lines);
  this._real.preSearchX = this.x;
  this._real.preSearchY = this.y;
  this.entryPrefix = 'Search: ';
  var bottom = this.ydisp + this.rows - 1;
  for (var i = 0; i < this.entryPrefix.length; i++) {
    //this.lines[bottom][i][0] = (this.defAttr & ~0x1ff) | 4;
    //this.lines[bottom][i][1] = this.entryPrefix[i];
    this.lines[bottom][i] = [
      (this.defAttr & ~0x1ff) | 4,
      this.entryPrefix[i]
    ];
  }
  this.y = this.rows - 1;
  this.x = this.entryPrefix.length;
  this.refresh(this.rows - 1, this.rows - 1);
};

Terminal.prototype.leaveSearch = function() {
  this.searchMode = false;

  if (this._real.preSearch) {
    this.lines = this._real.preSearch;
    this.x = this._real.preSearchX;
    this.y = this._real.preSearchY;
    delete this._real.preSearch;
    delete this._real.preSearchX;
    delete this._real.preSearchY;
  }

  this.refresh(this.rows - 1, this.rows - 1);
};

Terminal.prototype.copyBuffer = function(lines) {
  var lines = lines || this.lines
    , out = [];

  for (var y = 0; y < lines.length; y++) {
    out[y] = [];
    for (var x = 0; x < lines[y].length; x++) {
      out[y][x] = [lines[y][x][0], lines[y][x][1]];
    }
  }

  return out;
};

Terminal.prototype.getCopyTextarea = function(text) {
  var textarea = this._copyTextarea
    , document = this.document;

  if (!textarea) {
    textarea = document.createElement('textarea');
    textarea.style.position = 'absolute';
    textarea.style.left = '-32000px';
    textarea.style.top = '-32000px';
    textarea.style.width = '0px';
    textarea.style.height = '0px';
    textarea.style.opacity = '0';
    textarea.style.backgroundColor = 'transparent';
    textarea.style.borderStyle = 'none';
    textarea.style.outlineStyle = 'none';

    document.getElementsByTagName('body')[0].appendChild(textarea);

    this._copyTextarea = textarea;
  }

  return textarea;
};

// NOTE: Only works for primary selection on X11.
// Non-X11 users should use Ctrl-C instead.
Terminal.prototype.copyText = function(text) {
  var self = this
    , textarea = this.getCopyTextarea();

  this.emit('copy', text);

  textarea.focus();
  textarea.textContent = text;
  textarea.value = text;
  textarea.setSelectionRange(0, text.length);

  setTimeout(function() {
    self.element.focus();
    self.focus();
  }, 1);
};

Terminal.prototype.selectText = function(x1, x2, y1, y2) {
  var ox1
    , ox2
    , oy1
    , oy2
    , tmp
    , x
    , y
    , xl
    , attr;

  if (this._selected) {
    ox1 = this._selected.x1;
    ox2 = this._selected.x2;
    oy1 = this._selected.y1;
    oy2 = this._selected.y2;

    if (oy2 < oy1) {
      tmp = ox2;
      ox2 = ox1;
      ox1 = tmp;
      tmp = oy2;
      oy2 = oy1;
      oy1 = tmp;
    }

    if (ox2 < ox1 && oy1 === oy2) {
      tmp = ox2;
      ox2 = ox1;
      ox1 = tmp;
    }

    for (y = oy1; y <= oy2; y++) {
      x = 0;
      xl = this.cols - 1;
      if (y === oy1) {
        x = ox1;
      }
      if (y === oy2) {
        xl = ox2;
      }
      for (; x <= xl; x++) {
        if (this.lines[y][x].old != null) {
          //this.lines[y][x][0] = this.lines[y][x].old;
          //delete this.lines[y][x].old;
          attr = this.lines[y][x].old;
          delete this.lines[y][x].old;
          this.lines[y][x] = [attr, this.lines[y][x][1]];
        }
      }
    }

    y1 = this._selected.y1;
    x1 = this._selected.x1;
  }

  y1 = Math.max(y1, 0);
  y1 = Math.min(y1, this.ydisp + this.rows - 1);

  y2 = Math.max(y2, 0);
  y2 = Math.min(y2, this.ydisp + this.rows - 1);

  this._selected = { x1: x1, x2: x2, y1: y1, y2: y2 };

  if (y2 < y1) {
    tmp = x2;
    x2 = x1;
    x1 = tmp;
    tmp = y2;
    y2 = y1;
    y1 = tmp;
  }

  if (x2 < x1 && y1 === y2) {
    tmp = x2;
    x2 = x1;
    x1 = tmp;
  }

  for (y = y1; y <= y2; y++) {
    x = 0;
    xl = this.cols - 1;
    if (y === y1) {
      x = x1;
    }
    if (y === y2) {
      xl = x2;
    }
    for (; x <= xl; x++) {
      //this.lines[y][x].old = this.lines[y][x][0];
      //this.lines[y][x][0] &= ~0x1ff;
      //this.lines[y][x][0] |= (0x1ff << 9) | 4;
      attr = this.lines[y][x][0];
      this.lines[y][x] = [
        (attr & ~0x1ff) | ((0x1ff << 9) | 4),
        this.lines[y][x][1]
      ];
      this.lines[y][x].old = attr;
    }
  }

  y1 = y1 - this.ydisp;
  y2 = y2 - this.ydisp;

  y1 = Math.max(y1, 0);
  y1 = Math.min(y1, this.rows - 1);

  y2 = Math.max(y2, 0);
  y2 = Math.min(y2, this.rows - 1);

  //this.refresh(y1, y2);
  this.refresh(0, this.rows - 1);
};

Terminal.prototype.grabText = function(x1, x2, y1, y2) {
  var out = ''
    , buf = ''
    , ch
    , x
    , y
    , xl
    , tmp;

  if (y2 < y1) {
    tmp = x2;
    x2 = x1;
    x1 = tmp;
    tmp = y2;
    y2 = y1;
    y1 = tmp;
  }

  if (x2 < x1 && y1 === y2) {
    tmp = x2;
    x2 = x1;
    x1 = tmp;
  }

  for (y = y1; y <= y2; y++) {
    x = 0;
    xl = this.cols - 1;
    if (y === y1) {
      x = x1;
    }
    if (y === y2) {
      xl = x2;
    }
    for (; x <= xl; x++) {
      ch = this.lines[y][x][1];
      if (ch === ' ') {
        buf += ch;
        continue;
      }
      if (buf) {
        out += buf;
        buf = '';
      }
      out += ch;
      if (isWide(ch)) x++;
    }
    buf = '';
    out += '\n';
  }

  // If we're not at the end of the
  // line, don't add a newline.
  for (x = x2, y = y2; x < this.cols; x++) {
    if (this.lines[y][x][1] !== ' ') {
      out = out.slice(0, -1);
      break;
    }
  }

  return out;
};

Terminal.prototype.keyPrefix = function(ev, key) {
  if (key === 'k' || key === '&') {
    this.destroy();
  } else if (key === 'p' || key === ']') {
    this.emit('request paste');
  } else if (key === 'c') {
    this.emit('request create');
  } else if (key >= '0' && key <= '9') {
    key = +key - 1;
    if (!~key) key = 9;
    this.emit('request term', key);
  } else if (key === 'n') {
    this.emit('request term next');
  } else if (key === 'P') {
    this.emit('request term previous');
  } else if (key === ':') {
    this.emit('request command mode');
  } else if (key === '[') {
    this.enterSelect();
  }
};

Terminal.prototype.keySelect = function(ev, key) {
  this.showCursor();

  if (this.searchMode || key === 'n' || key === 'N') {
    return this.keySearch(ev, key);
  }

  if (key === '\x04') { // ctrl-d
    var y = this.ydisp + this.y;
    if (this.ydisp === this.ybase) {
      // Mimic vim behavior
      this.y = Math.min(this.y + (this.rows - 1) / 2 | 0, this.rows - 1);
      this.refresh(0, this.rows - 1);
    } else {
      this.scrollDisp((this.rows - 1) / 2 | 0);
    }
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    }
    return;
  }

  if (key === '\x15') { // ctrl-u
    var y = this.ydisp + this.y;
    if (this.ydisp === 0) {
      // Mimic vim behavior
      this.y = Math.max(this.y - (this.rows - 1) / 2 | 0, 0);
      this.refresh(0, this.rows - 1);
    } else {
      this.scrollDisp(-(this.rows - 1) / 2 | 0);
    }
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    }
    return;
  }

  if (key === '\x06') { // ctrl-f
    var y = this.ydisp + this.y;
    this.scrollDisp(this.rows - 1);
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    }
    return;
  }

  if (key === '\x02') { // ctrl-b
    var y = this.ydisp + this.y;
    this.scrollDisp(-(this.rows - 1));
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    }
    return;
  }

  if (key === 'k') {
    var y = this.ydisp + this.y;
    this.y--;
    if (this.y < 0) {
      this.y = 0;
      this.scrollDisp(-1);
    }
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    } else {
      this.refresh(this.y, this.y + 1);
    }
    return;
  }

  if (key === 'j') {
    var y = this.ydisp + this.y;
    this.y++;
    if (this.y >= this.rows) {
      this.y = this.rows - 1;
      this.scrollDisp(1);
    }
    if (this.visualMode) {
      this.selectText(this.x, this.x, y, this.ydisp + this.y);
    } else {
      this.refresh(this.y - 1, this.y);
    }
    return;
  }

  if (key === 'h') {
    var x = this.x;
    this.x--;
    if (this.x < 0) {
      this.x = 0;
    }
    if (this.visualMode) {
      this.selectText(this.x, x, this.ydisp + this.y, this.ydisp + this.y);
    } else {
      this.refresh(this.y, this.y);
    }
    return;
  }

  if (key === 'l') {
    var x = this.x;
    this.x++;
    if (this.x >= this.cols) {
      this.x = this.cols - 1;
    }
    if (this.visualMode) {
      this.selectText(x, this.x, this.ydisp + this.y, this.ydisp + this.y);
    } else {
      this.refresh(this.y, this.y);
    }
    return;
  }

  if (key === 'v' || key === ' ') {
    if (!this.visualMode) {
      this.enterVisual();
    } else {
      this.leaveVisual();
    }
    return;
  }

  if (key === 'y') {
    if (this.visualMode) {
      var text = this.grabText(
        this._selected.x1, this._selected.x2,
        this._selected.y1, this._selected.y2);
      this.copyText(text);
      this.leaveVisual();
      // this.leaveSelect();
    }
    return;
  }

  if (key === 'q') {
    if (this.visualMode) {
      this.leaveVisual();
    } else {
      this.leaveSelect();
    }
    return;
  }

  if (key === 'w' || key === 'W') {
    var ox = this.x;
    var oy = this.y;
    var oyd = this.ydisp;

    var x = this.x;
    var y = this.y;
    var yb = this.ydisp;
    var saw_space = false;

    for (;;) {
      var line = this.lines[yb + y];
      while (x < this.cols) {
        if (line[x][1] <= ' ') {
          saw_space = true;
        } else if (saw_space) {
          break;
        }
        x++;
      }
      if (x >= this.cols) x = this.cols - 1;
      if (x === this.cols - 1 && line[x][1] <= ' ') {
        x = 0;
        if (++y >= this.rows) {
          y--;
          if (++yb > this.ybase) {
            yb = this.ybase;
            x = this.x;
            break;
          }
        }
        continue;
      }
      break;
    }

    this.x = x, this.y = y;
    this.scrollDisp(-this.ydisp + yb);

    if (this.visualMode) {
      this.selectText(ox, this.x, oy + oyd, this.ydisp + this.y);
    }
    return;
  }

  if (key === 'b' || key === 'B') {
    var ox = this.x;
    var oy = this.y;
    var oyd = this.ydisp;

    var x = this.x;
    var y = this.y;
    var yb = this.ydisp;

    for (;;) {
      var line = this.lines[yb + y];
      var saw_space = x > 0 && line[x][1] > ' ' && line[x - 1][1] > ' ';
      while (x >= 0) {
        if (line[x][1] <= ' ') {
          if (saw_space && (x + 1 < this.cols && line[x + 1][1] > ' ')) {
            x++;
            break;
          } else {
            saw_space = true;
          }
        }
        x--;
      }
      if (x < 0) x = 0;
      if (x === 0 && (line[x][1] <= ' ' || !saw_space)) {
        x = this.cols - 1;
        if (--y < 0) {
          y++;
          if (--yb < 0) {
            yb++;
            x = 0;
            break;
          }
        }
        continue;
      }
      break;
    }

    this.x = x, this.y = y;
    this.scrollDisp(-this.ydisp + yb);

    if (this.visualMode) {
      this.selectText(this.x, ox, this.ydisp + this.y, oy + oyd);
    }
    return;
  }

  if (key === 'e' || key === 'E') {
    var x = this.x + 1;
    var y = this.y;
    var yb = this.ydisp;
    if (x >= this.cols) x--;

    for (;;) {
      var line = this.lines[yb + y];
      while (x < this.cols) {
        if (line[x][1] <= ' ') {
          x++;
        } else {
          break;
        }
      }
      while (x < this.cols) {
        if (line[x][1] <= ' ') {
          if (x - 1 >= 0 && line[x - 1][1] > ' ') {
            x--;
            break;
          }
        }
        x++;
      }
      if (x >= this.cols) x = this.cols - 1;
      if (x === this.cols - 1 && line[x][1] <= ' ') {
        x = 0;
        if (++y >= this.rows) {
          y--;
          if (++yb > this.ybase) {
            yb = this.ybase;
            break;
          }
        }
        continue;
      }
      break;
    }

    this.x = x, this.y = y;
    this.scrollDisp(-this.ydisp + yb);

    if (this.visualMode) {
      this.selectText(ox, this.x, oy + oyd, this.ydisp + this.y);
    }
    return;
  }

  if (key === '^' || key === '0') {
    var ox = this.x;

    if (key === '0') {
      this.x = 0;
    } else if (key === '^') {
      var line = this.lines[this.ydisp + this.y];
      var x = 0;
      while (x < this.cols) {
        if (line[x][1] > ' ') {
          break;
        }
        x++;
      }
      if (x >= this.cols) x = this.cols - 1;
      this.x = x;
    }

    if (this.visualMode) {
      this.selectText(this.x, ox, this.ydisp + this.y, this.ydisp + this.y);
    } else {
      this.refresh(this.y, this.y);
    }
    return;
  }

  if (key === '$') {
    var ox = this.x;
    var line = this.lines[this.ydisp + this.y];
    var x = this.cols - 1;
    while (x >= 0) {
      if (line[x][1] > ' ') {
        if (this.visualMode && x < this.cols - 1) x++;
        break;
      }
      x--;
    }
    if (x < 0) x = 0;
    this.x = x;
    if (this.visualMode) {
      this.selectText(ox, this.x, this.ydisp + this.y, this.ydisp + this.y);
    } else {
      this.refresh(this.y, this.y);
    }
    return;
  }

  if (key === 'g' || key === 'G') {
    var ox = this.x;
    var oy = this.y;
    var oyd = this.ydisp;
    if (key === 'g') {
      this.x = 0, this.y = 0;
      this.scrollDisp(-this.ydisp);
    } else if (key === 'G') {
      this.x = 0, this.y = this.rows - 1;
      this.scrollDisp(this.ybase);
    }
    if (this.visualMode) {
      this.selectText(ox, this.x, oy + oyd, this.ydisp + this.y);
    }
    return;
  }

  if (key === 'H' || key === 'M' || key === 'L') {
    var ox = this.x;
    var oy = this.y;
    if (key === 'H') {
      this.x = 0, this.y = 0;
    } else if (key === 'M') {
      this.x = 0, this.y = this.rows / 2 | 0;
    } else if (key === 'L') {
      this.x = 0, this.y = this.rows - 1;
    }
    if (this.visualMode) {
      this.selectText(ox, this.x, this.ydisp + oy, this.ydisp + this.y);
    } else {
      this.refresh(oy, oy);
      this.refresh(this.y, this.y);
    }
    return;
  }

  if (key === '{' || key === '}') {
    var ox = this.x;
    var oy = this.y;
    var oyd = this.ydisp;

    var line;
    var saw_full = false;
    var found = false;
    var first_is_space = -1;
    var y = this.y + (key === '{' ? -1 : 1);
    var yb = this.ydisp;
    var i;

    if (key === '{') {
      if (y < 0) {
        y++;
        if (yb > 0) yb--;
      }
    } else if (key === '}') {
      if (y >= this.rows) {
        y--;
        if (yb < this.ybase) yb++;
      }
    }

    for (;;) {
      line = this.lines[yb + y];

      for (i = 0; i < this.cols; i++) {
        if (line[i][1] > ' ') {
          if (first_is_space === -1) {
            first_is_space = 0;
          }
          saw_full = true;
          break;
        } else if (i === this.cols - 1) {
          if (first_is_space === -1) {
            first_is_space = 1;
          } else if (first_is_space === 0) {
            found = true;
          } else if (first_is_space === 1) {
            if (saw_full) found = true;
          }
          break;
        }
      }

      if (found) break;

      if (key === '{') {
        y--;
        if (y < 0) {
          y++;
          if (yb > 0) yb--;
          else break;
        }
      } else if (key === '}') {
        y++;
        if (y >= this.rows) {
          y--;
          if (yb < this.ybase) yb++;
          else break;
        }
      }
    }

    if (!found) {
      if (key === '{') {
        y = 0;
        yb = 0;
      } else if (key === '}') {
        y = this.rows - 1;
        yb = this.ybase;
      }
    }

    this.x = 0, this.y = y;
    this.scrollDisp(-this.ydisp + yb);

    if (this.visualMode) {
      this.selectText(ox, this.x, oy + oyd, this.ydisp + this.y);
    }
    return;
  }

  if (key === '/' || key === '?') {
    if (!this.visualMode) {
      this.enterSearch(key === '/');
    }
    return;
  }

  return false;
};

Terminal.prototype.keySearch = function(ev, key) {
  if (key === '\x1b') {
    this.leaveSearch();
    return;
  }

  if (key === '\r' || (!this.searchMode && (key === 'n' || key === 'N'))) {
    this.leaveSearch();

    var entry = this.entry;

    if (!entry) {
      this.refresh(0, this.rows - 1);
      return;
    }

    var ox = this.x;
    var oy = this.y;
    var oyd = this.ydisp;

    var line;
    var found = false;
    var wrapped = false;
    var x = this.x + 1;
    var y = this.ydisp + this.y;
    var yb, i;
    var up = key === 'N'
      ? this.searchDown
      : !this.searchDown;

    for (;;) {
      line = this.lines[y];

      while (x < this.cols) {
        for (i = 0; i < entry.length; i++) {
          if (x + i >= this.cols) break;
          if (line[x + i][1] !== entry[i]) {
            break;
          } else if (line[x + i][1] === entry[i] && i === entry.length - 1) {
            found = true;
            break;
          }
        }
        if (found) break;
        x += i + 1;
      }
      if (found) break;

      x = 0;

      if (!up) {
        y++;
        if (y > this.ybase + this.rows - 1) {
          if (wrapped) break;
          // this.setMessage('Search wrapped. Continuing at TOP.');
          wrapped = true;
          y = 0;
        }
      } else {
        y--;
        if (y < 0) {
          if (wrapped) break;
          // this.setMessage('Search wrapped. Continuing at BOTTOM.');
          wrapped = true;
          y = this.ybase + this.rows - 1;
        }
      }
    }

    if (found) {
      if (y - this.ybase < 0) {
        yb = y;
        y = 0;
        if (yb > this.ybase) {
          y = yb - this.ybase;
          yb = this.ybase;
        }
      } else {
        yb = this.ybase;
        y -= this.ybase;
      }

      this.x = x, this.y = y;
      this.scrollDisp(-this.ydisp + yb);

      if (this.visualMode) {
        this.selectText(ox, this.x, oy + oyd, this.ydisp + this.y);
      }
      return;
    }

    // this.setMessage("No matches found.");
    this.refresh(0, this.rows - 1);

    return;
  }

  if (key === '\b' || key === '\x7f') {
    if (this.entry.length === 0) return;
    var bottom = this.ydisp + this.rows - 1;
    this.entry = this.entry.slice(0, -1);
    var i = this.entryPrefix.length + this.entry.length;
    //this.lines[bottom][i][1] = ' ';
    this.lines[bottom][i] = [
      this.lines[bottom][i][0],
      ' '
    ];
    this.x--;
    this.refresh(this.rows - 1, this.rows - 1);
    this.refresh(this.y, this.y);
    return;
  }

  if (key.length === 1 && key >= ' ' && key <= '~') {
    var bottom = this.ydisp + this.rows - 1;
    this.entry += key;
    var i = this.entryPrefix.length + this.entry.length - 1;
    //this.lines[bottom][i][0] = (this.defAttr & ~0x1ff) | 4;
    //this.lines[bottom][i][1] = key;
    this.lines[bottom][i] = [
      (this.defAttr & ~0x1ff) | 4,
      key
    ];
    this.x++;
    this.refresh(this.rows - 1, this.rows - 1);
    this.refresh(this.y, this.y);
    return;
  }

  return false;
};

 * Character Sets

    <script>
function Animator(recording) {
  this.rec = recording;
  this.widget = $("<div id='"+recording.name+"' style='display:none;'></div>").appendTo('body');
  this.counter = -1;
  this.term = new Terminal({ cols: this.rec.cols , rows: this.rec.lines, useStyle: true, screenKeys: true });
  this.vterm_div = $("<div></div>").appendTo(this.widget);
  this.term.open(this.vterm_div[0]);

  if ($('#dugmeVrati').length == 0) {
    var isFirefox = typeof InstallTrigger !== 'undefined';
    if (isFirefox) {
    	var firefoxCss = "<style type='text/css'>" + 
    				 ".terminal { margin-bottom: 60px; }" +
	 			 "#dugmeVrati { margin-top: 450px; position:absolute; display:block; width: 50px; }" +
	 			 "#dugmePlay { display:block; width: 50px; position:absolute; margin-top: 450px; margin-left: 55px; }" +
	 			 "#dugmeStop { display:block;position:absolute; margin-top: 450px; margin-left: 110px; width: 50px; }" +
	 			 "#dugmeUbrzaj { display:block;position:absolute; margin-top: 450px; margin-left: 165px; width: 50px; }" +
 			 "</style>";
	$("head").append(firefoxCss);
    } else { 
    	var chromeCss = "<style type='text/css'>" + 
	 			".terminal { margin-bottom: 20px; }" +
	 			"#dugmeVrati { position:relative; display:block; width: 50px; }" +
	 			"#dugmePlay { display:block; width: 50px; position:absolute; margin-top: -23px; margin-left: 55px; }" +
	 			"#dugmeStop { display:block;position:absolute; margin-top: -23px; margin-left: 110px; width: 50px; }" +
	 			"#dugmeUbrzaj { display:block;position:absolute; margin-top: -23px; margin-left: 165px; width: 50px; }" +
 		        "</style>";
	$("head").append(chromeCss);
    }
  }

  this.dugmeVrati = $("<button id='dugmeVrati'><<</button>").appendTo(this.widget);
  this.dugmePlayPause = $("<button id='dugmePlay'>&#9658;</button>").appendTo(this.widget);
  this.dugmeStop = $("<button id='dugmeStop'>&#9689;</button>").appendTo(this.widget);
  this.dugmeUbrzaj = $("<button id='dugmeUbrzaj'>>></button>").appendTo(this.widget);

  this.timer = {};
  this.state = "paused";
  var that = this;
  
  this.dugmePlayPause.click(function() { 
    if ( that.state == "paused" ) {
      that.state = "playing";
      $("#"+recording.name).find("#dugmePlay").html("&nbsp;&nbsp;||&nbsp;&nbsp;");
      that.animate();
    } else {
      that.state = "paused";
      $("#"+recording.name).find("#dugmePlay").html("&#9658;");
      window.clearTimeout(that.timer);
    }
  });
  
  this.dugmeVrati.click(function() { 
    if (that.counter > 0) {
	  window.clearTimeout(that.timer);
	    
	  if (that.counter > 5)
		that.counter = that.counter - 5;
	  else 
		that.counter = 0;
	    
	  that.term.write("\x1b[2J\x1b[H");
	    
	  for (i=0; i<=that.counter; i++) {
	   	that.term.write(String.fromCharCode.apply(null,that.rec.content[i]));
	  }
	    
	  if (that.state == "playing")
	   	that.animate();
    }
  });
  
  this.dugmeUbrzaj.click(function() { 
    window.clearTimeout(that.timer);
    
    if ((that.counter + 5) < (that.rec.content.length - 1))
    	that.counter = that.counter + 5;
    else
    	that.counter = that.rec.content.length;
    
    that.term.write("\x1b[2J\x1b[H");
    for (i=0; i<=that.counter; i++) {
    	that.term.write(String.fromCharCode.apply(null,that.rec.content[i]));
    }
    
    if (that.state == "playing")
    	that.animate();
  });
  
  this.dugmeStop.click(function() { 
    window.clearTimeout(that.timer);
    that.state = "paused";
    $("#"+recording.name).find("#dugmePlay").html("&#9658;");
    that.counter = -1;
    that.term.write("\x1b[2J\x1b[H");
  });
  
  this.animate = function() {
    if ( that.counter < that.rec.content.length-1) {
      ++that.counter;
      that.term.write(String.fromCharCode.apply(null,that.rec.content[that.counter]));
      that.timer = window.setTimeout(that.animate,that.rec.frames[that.counter][0]*1000);
    } else {
      window.clearTimeout(that.timer);
      that.state = "paused";
      that.counter = -1;
      $("#"+recording.name).find("#dugmePlay").html("&#9658;");
      that.term.write("\x1b[2J\x1b[H");
    }
  };
}

    <script>
      function printaj() {
        $('#promjena').jmpress('deinit');
        var old_op=$('.step:not(.active)').css('opacity');
        $('.step:not(.active)').css('opacity',1);
        window.print();
        $('.step:not(.active)').css('opacity',old_op);
        $('#promjena').jmpress();
      }

      function zamotaj() {
        var hrs = $('#promjena hr');
        for ( var i = 0; i < hrs.length; ++i) {
          hrs.slice(i).first().nextUntil('hr').wrapAll(["<div class='step'","data-x=",i*1000," id='slide",i, "'></div>"].join(""));
        }
        hrs.remove();
      }

      function jednacine(val) {

----

# Relacije među klasama

Kreiranjem klasa, kreiramo nove tipove od kojih možemo stvarati instance tj objekte.

Nove klase prave se pomoću drugih klasa i/ili primitivnih tipova. 

  Analizom problema identificiraju se potrebne klase kao i njihove međusobne relacije.

-----

Dva tipa relacija između klasa često proizilaze iz analize, i to:

* relacija __ima__ (has-a)
 
 * često se još naziva i _kompozicija_ i/ili _agregacija_, i korištena je u dosadašnjim predavanjima za kreiranje klasa.
 * npr. student _ima_ broj indeksa, univerzitet _ima_ fakultete, rukovodilac _ima_ svoje radnike.

* relacija __je__ (is-a)
 
 * npr. golub _je_ ptica, radnik _je_ osoba, krug _je_ geometrijski oblik.

----

# Naslijeđivanje


Ukoliko `C++` tip _subklasa_ ima odnos _je_ sa tipom _superklasa_, tada je svaki objekat tipa _subklasa_ u isto vrijeme i tipa _superklasa_, obrnuto ne važi.

 * svaki golub je ptica, ali svaka ptica ne mora biti golub.

Relacija _je_ u C++-u se modelira na način da se _subklasa_ izvodi (derivira) iz _superklase_ (često je u upotrebi i termin bazna (base) klasa);

 * nakon čega _subklasa_ naslijeđuje sve metode i članove od _superklase_, te ima mogućnost da definira i nove.

-----

# Definicija subklase

Subklasa se definira u obliku:

``` cpp 
class subklasa : tip_naslijeđivanja superklasa { // ... 
}
```

* Ukoliko se `tip_naslijeđivanja` označi kao  `public`, tada svi naslijeđeni metodi i članovi koji su bili javni u superklasi ostaju javni i u subklasi.

* Ukoliko je `tip_naslijeđivanja` označen kao `private` svi naslijeđeni metodi i članovi deklarirani kao javni u superklasi bit će privatni u subklasi. 

* Ukoliko se `tip_naslijeđivanja` izostavi, uzet će se kao `private` ako je subklasa definirana sa `class`, tj. kao `public` ukoliko je subklasa definirana sa `struct`.

-----


Bez obzira na tip naslijeđivanja, naslijeđeni članovi i metodi koji su privatni u baznoj klasi neće biti direktno dostupni u metodima izvedene klase. &lt;a href="#snimak1" id="snimak1_link"&gt;Primjer&lt;/a&gt;

Pored `public` i `private` deklaracije pristupa u klasi postoji još i `protected` pristup:
 
* članovi i metodi deklarirani u `protected` sekciji klase bit će direktno dostupni u metodima te klase i unutar metoda svih njenih izvedenih klasa.

 * za javni tip naslijeđivanja članovi označeni kao `protected` u baznoj klasi ostat će označeni kao `protected` u izvedenoj klasi;

 * dok će za privatni tip naslijeđivanja biti označeni kao `private` u izvedenoj klasi.

----

# Subklasa konstrukcija

Objekat izvedene klase sastoji se iz dva dijela:

 * prvi dio su njegovi članovi naslijeđeni iz bazne klase;
 * drugi dio su njegovi članovi dodati u definiciji izvedene klase.


Oba dijela objekta potrebno je ispravno inicijalizirati u konstruktoru izvedene klase. 

----

Redosljed u inicijalizaciji objekta izvedene klase nakon alokacije potrebne memorije je:

1. prvo se inicijalizira naslijeđeni dio objekta i to pozivom nekog od konstruktora bazne klase;

 * ako se u listi za inicijalizaciju konstruktora izvedene klase izostavi poziv nekog od konstruktora bazne klase, kompajler poziva default konstruktor bazne klase, ako isti ne postoji kod se neće moći kompajlirati.

2. nakon čega se pozivaju konstruktori članova koji su definirani u izvedenoj klasi, i to u skladu sa redosljedom njihove definicije;

3. na kraju će se izvršiti tijelo konstruktor metoda izvedene klase.

-----

Destrukcija objekta tipa subklase obavlja se obrnuto od konstrukcije: 

1. prvo se poziva destruktor metod od izvedene klase;
2. nakon čega se pozivaju destruktor metodi članova koji su definirani u izvedenoj klasi;
3. pa se pokreće destrukcija dijela objekta koji je  naslijeđen iz bazne klase pozivom destruktor metoda bazne klase.
4. na kraju se oslobodi memorija koju je objekat zauzimao.

&lt;a href="#snimak2" id="snimak2_link"&gt;Primjer&lt;/a&gt;


----

# Ponašanje objekata subklase

Svakom objektu izvedene klase moguće je pristupiti preko pointera (ili reference) na baznu klasu,

  * te pozivati metode preko tog pointera ili reference, ali samo one koji su deklarirani u definiciji bazne klase. 

Preko ovog pointera (ili reference) objekat se ponaša kao objekat tipa bazne klase (iako u memoriji egzistira kao objekat tipa izvedene klase)

&lt;a href="#snimak3" id="snimak3_link"&gt;Primjer&lt;/a&gt;

---

``` cpp
class A { // ....
};
class B : public A { // ...
};
```

Neka je dat slijedeći `C++` kod
``` cpp
B b;
A a = b;
```

Objekat `a` bazne klase inicijalizira se preko objekta `b` izvedene klase:

* inicijalizacija se vrši pozivom copy konstruktora klase `A` jer isti ima potpis `A(const A&amp;)`;

* članovi i metodi objekta `b` koji su dodati u klasi `B` odbacuju se u objektu `a`, i u njemu ostaju samo kopije članova iz `b` koji su naslijeđeni iz klase `A`.

----

# Redefinicija naslijeđenih metoda

`C++` dozvoljava da se naslijeđeni metodi redefinišu u izvedenoj klasi.

1. kada se pozove neki redefinisani metod direktno na objektu izvedene klase, izvršit će se varijanta metoda implementirana u izvedenoj klasi.
2. kada se poziv izvrši preko reference ili pointera na baznu klasu, izvršit će se varijanta metoda implementirana u baznoj klasi.

 * čak i za slučaj da je pointer (ili referenca) vezan za objekat izvedene klase.

Označavanjem metoda kao __`virtual`__ u baznoj klasi, ponašanje 2. se može promjeniti na način da će se izvršiti varijanta metoda implementirana u izvedenoj klasi ukoliko pointer (ili referenca) pokazuje na objekat izvedene klase koja je izvršila redefiniranje tog metoda.

&lt;a href="#snimak4" id="snimak4_link"&gt;Primjer&lt;/a&gt;

# Čisti virtuelni metodi

Ukoliko se nakon deklaracije nekog virtuelnog metode u baznoj klasi postavi `=0` taj metod postaje __čisti virtuelni metod__.

* ovim se najavljuje da klasa neće imati implementaciju tog metoda. 

Ukoliko klasa ima makar jedan čisti virtuelni metod tada postaje abstraktna i od nje nije moguće direktno instancirati objekte.

* od ove klase se samo mogu praviti izvedene klase koje moraju implementirati sve čiste virtuelne metode ove klase da i same ne bi bile abstraktne.

Klase koje nemaju članove a imaju samo čiste virtuelne metode često se nazivaju _interface_ klase.

----

``` cpp
#include &lt;iostream&gt;
#include &lt;vector&gt;

struct Objekat {
  Objekat(int x, int y) : x_(x), y_(y) {}
  virtual ~Objekat() { 
    std::cout &lt;&lt; "Dest. Obj. Koord: x=" &lt;&lt; x_ &lt;&lt; ", y=" &lt;&lt; y_ &lt;&lt; std::endl;
  }
  virtual double povrsina() = 0;
  protected:
  int x_, y_;
};

using vek_obj_ptr = std::vector&lt;Objekat*&gt;;

double suma_povrsina(const vek_obj_ptr&amp; v) {
  double p=0;
  for (const auto&amp; el : v) 
    p += el-&gt;povrsina();
  return p;
}

// nastavak na slijedecem slajdu
```

-----

``` cpp
class Krug : public Objekat {
  public:
    Krug(int x, int y, int r) : Objekat(x,y), r_(r) {}
    ~Krug() { std::cout &lt;&lt; "Dest. Krug.\n"; }   
    double povrsina() { return 3.14*r_*r_; }
  private:
    int r_;
};

class Kvadrat : public Objekat {
  public:
    Kvadrat(int x, int y, int a ) : Objekat(x,y), a_(0) {}
    ~Kvadrat() { std::cout &lt;&lt; "Dest. Kvadrat.\n"; }   
    double povrsina() { return a_*a_; }
  private:
    int a_;
};

// nastavak na slijedecem slajdu
```

-----

``` cpp
int main() {

  vek_obj_ptr v;

  v.push_back(new Kvadrat(2,3,3));
  v.push_back(new Krug(18,4,4));
  v.push_back(new Kvadrat(8,5,10));

  std::cout &lt;&lt; "Povrsina svih objekata je: " &lt;&lt; suma_povrsina(v) &lt;&lt; std::endl;

  for( auto ptr : v )
    delete ptr;

  return 0;
}
```
